import React from 'react';
import './timeTable.css';

const timeTable = ({ onRouteChange }) => {
	return(
		<div className='tt'>
			<div className='time'>
				<p>Days</p>
				<p>9-10 am</p>
				<p>10-11 am</p>
				<p>11-12 am</p>
				<p>12-1 pm</p>
				<p>1-2 pm</p>
				<p>2-3 pm</p>
				<p>3-4 pm</p>
				<p>4-5 pm</p>
				<p>5-6 pm</p>
			</div>
		</div>
	)
}

export default timeTable;
